import { Component, OnDestroy, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { Subscription } from 'rxjs/internal/Subscription';
import { Location } from '@angular/common';
import { ApiService } from 'src/app/services/api.service';

@Component({
  selector: 'app-resetpassword',
  templateUrl: './resetpassword.component.html',
  styleUrls: ['./resetpassword.component.css']
})
export class ResetpasswordComponent implements  OnDestroy {

  subscription?: Subscription;
  _email=this.route.snapshot.paramMap.get('emailAddress')!;
  _token=this.route.snapshot.paramMap.get('token')!;
  _password=this.route.snapshot.paramMap.get('token')!;
  _confirmPassword=this.route.snapshot.paramMap.get('token')!;

  constructor(
    private apiService: ApiService,
    private route: ActivatedRoute,
    private location: Location,
  ) {}

  resetPassword():void{}

  ngOnDestroy(): void {
    if (this.subscription) {
      this.subscription.unsubscribe();
    }
  }
}
